import React, { useState } from 'react';
import Layout from '../../layout/Layout';
import { Button, Table } from 'react-bootstrap';
import ReactPagination from './ReactPagination';

const User = (props) => {
  const [activePage, setActivePage] = useState(1);
  const [pageLimit, setPageLimit] = useState(5);
  const [totalCount, setTotalCount] = useState(20);
  console.log(props.userData, 'uuuuuuuuuu');

  const handlePageChange = (pageNumber) => {
    console.log(pageNumber, 'ppppppppp');
    setActivePage(pageNumber);
  };

  return (
    <>
      <Layout>
        <Button variant="primary" onClick={props.handleAdd}>
          add
        </Button>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>State</th>
              <th>Title</th>
              <th> Action</th>
            </tr>
          </thead>
          {props.userData &&
            props.userData.map((data) => (
              <tbody>
                <tr>
                  <td>{data.state}</td>
                  <td>{data.title}</td>
                  <td>
                    <Button onClick={() => props.handleEdit(data)}>edit</Button>
                    <Button onClick={() => props.handledelete(data.id)}>
                      Delete
                    </Button>
                  </td>
                </tr>
              </tbody>
            ))}
        </Table>
        <ReactPagination
          activePage={activePage}
          totalCount={totalCount}
          pageLimit={pageLimit}
          handlePageChange={handlePageChange}
        />
      </Layout>
    </>
  );
};
export default User;
